oords='509,499,586,531' href='http://www.dj-lafuente.com/' shape='rect' target='_blank' title='La Fuente'> <area alt='Quintino' coords='560,468,650,500' href='http://www.quintino.nl/' shape='rect' target='_blank' title='Quintino'> <area alt='Real El Canario' coords='561,419,642,470' href='http://www.realelcanario.net/' shape='rect' target='_blank' title='Real El Canario'> <area alt='Vato Gonzalez' coords='492,389,644,410' href='http://www.vato.nl/' shape='rect' target='_blank' title='Vato Gonzalez'> <area alt='Marco Joosten' coords='464,246,659,272' href='http://www.marcojoosten.com/' shape='rect' target='_blank' title='Marco Joosten'> <area alt='Jochen Miller' coords='451,188,649,226' href='http://www.jochenmiller.com/' shape='rect' target='_blank' title='Jochen Miller'> <area alt='Marco V' coords='512,105,662,140' href='http://www.marcov.nl/site/' shape='rect' target='_blank' title='Marco V'> <area alt='Ferry Corsten' coords='458,85,661,109' href='http://www.ferrycorsten.com/' shape='rect' target='_blank' title='Ferry Corsten'> <\/map>",cyb='<null message>',iGb='<object width="640" height="385"><param name="movie" value="http://www.youtube.com/v/dHz-ljBe7to&hl=en_US&fs=1&rel=0&color1=0x006699&color2=0x54abd6"><\/param><param name="allowFullScreen" value="true"><\/param><param name="allowscriptaccess" value="always"><\/param><embed src="http://www.youtube.com/v/dHz-ljBe7to&hl=en_US&fs=1&rel=0&color1=0x006699&color2=0x54abd6&autoplay=1" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="640" height="385"><\/embed><\/object>',vGb='<p class="sub">Thanx...<\/p><p class="tittle">',wHb="<p class='tittle'>Locatie<\/p> <p> De locatie van Salvationz, het E3 Strand, is gelegen in Eersel. <\/p> <p> Een ideale locatie in Noord-Brabant voor een dance festival! <\/p> <p> Het E3 Strand is omgeven door helder water en een mooi zandstrand met een afgeschermde, bosrijke omgeving als decor. Vanaf de snelweg ben je in nog geen 5 minuten in een compleet andere omgeving. Het E3 Strand is uitstekend bereikbaar per auto, taxi, openbaar vervoer en fiets. Met 4000 parkeerplaatsen is er ruime parkeergelegenheid voor bezoekers. <\/p> <p> Houd de site in de gaten voor het laatste nieuws over de mogelijkheden! <\/p> <span id='",EHb="<p class='tittle'>Party at the lake, Sleep in the forest...<\/p> <p class='sub'> Sluit Salvationz af met een heerlijke overnachting in NH Koningshof. <\/p> <p> Word wakker in een door bossen omgeven hotel en geniet van een uitgebreid ontbijtbuffet. Na een verfrissende duik in het zwembad is het weekend zeker geslaagd. <\/p> <p> <span id='",uHb="<p class='tittle'>Routeschrijving E3 Strand, Buivensedreef in Eersel<\/p> <img src='/salvationz/img/e3Map.png'> <p class='sub'> Vanuit Eindhoven/Veldhoven/Venlo/Duitsland: <\/p> <p> Volg de autosnelweg A67, richting Turnhout. Neem afslag 32, dan rechtsaf borden E3-strand volgen. Rechtsaf bij carpoolplaats en de bochtige weg volgen tot ingang E3-strand. Rechtsaf door witte poort de weg volgen naar parking. <\/p> <p class='sub'> Vanuit Turnhout/Antwerpen: <\/p> <p> Volg de autosnelweg A67 noord-oostwaarts, richting Eindhoven. Neem afslag 32, dan linksaf borden E3-strand volgen. (vervolg zie boven) <\/p> <p class='sub'> Vanuit Valkenswaard: <\/p> <p> Provincialeweg N612 volgen richting Dommelen, Eersel. Bij rotonde Het Stuivertje voorbij Eersel rechtdoor weg volgen. (vervolg zie boven) <\/p> <p class='sub'> Vanuit Maastricht: <\/p> <p> Autosnelweg A2 noordwaarts richting Eindhoven. Bij verkeersplein Leenderheide linksaf.... (vervolg zie boven) <\/p> <p class='sub'> Vanuit Tilburg: <\/p> <p> Na autosnelweg A58 bij Batadorp de A2 gaan volgen zuidwaarts. Afslag richting Eersel/Turnhout nemen (vervolg zie boven &gt;) <\/p> <p class='sub'> Vanuit Den Bosch/Best: <\/p> <p> Autosnelweg A2 zuidwaarts richting Eindhoven. Bij Ekkersweijer rechts aanhouden A58 volgen richting Tilburg. Direct bij eerste afslag A58 verlaten bij Batadorp en A2 gaan volgen zuidwaarts. Afslag richting Eersel/Turnhout nemen.... (vervolg zie boven&gt;) <\/p> <span id='",DHb="<p class='tittle'>Salvationz slaat op 12 juni 2010 haar vleugels uit op het E3 Strand in Eersel.<\/p> <p class='sub'>Van 11:00 uur tot 23:00 uur zal er House, Eclectic, Club, Progressive &amp; Trance uit de speakers knallen.<\/p> <p>Het wordt een uitgepakte eerste editie van Salvationz met een gevarieerde en zeer aansprekende Line up!!<\/p> <p>Bij Salvationz staat de totaalbeleving centraal, dus naast een lekkere sound en optimale food &amp; beverage voorzieningen, mogen uitdagende dansshows en verrassende theater acts op het terrein natuurlijk niet ontbreken. Salvationz is een euforische trip van het moment dat je binnen komt tot je weer voldaan naar huis gaat. <\/p> <p class='sub'>\u201CEnjoy earth like heaven\u201D<\/p> <p>De Early bird tickets \xE1 \u20AC 25,- (ex. Fee) zijn vanaf nu verkrijgbaar op www.salvationz.nl en bij alle Primera verkooppunten. De Early birds zijn verkrijgbaar tot 16 april 2010, dus ben er snel bij! Reguliere tickets kosten \u20AC 32,50 (ex. Fee) <\/p> <p>Pendeldiensten zijn mogelijk vanaf station Eindhoven. Een hotelovernachting in het Koningshof te Veldhoven is tevens mogelijk, check de button \u201CLocation\u201D voor meer informatie. Houd deze site in de gaten voor de vele mogelijkheden en het laatste nieuws over Salvationz!! <\/p>",IGb='<p class=tittle>Organisatie<\/p><p><a href="http://www.guaranteevents.nl" target="_blank"><img src="/salvationz/img/ge.jpg" href="http://www.guaranteevents.nl"><br>Guaranteevents<\/a><br><a href=mailto:info@salvationz.nl>mail@guaranteevents.nl<\/a><\/p><p class=tittle>E-tickets<\/p><p>Voor alle vragen over e-ticket...<br><a href=mailto:e-tickets@salvationz.nl>e-tickets@salvationz.nl<\/a><\/p><p class=tittle>Marketing en communicatie<\/p><p>Voor alle promotionele activiteiten...<br><a href=mailto:MC@salvationz.nl>MC@salvationz.nl<\/a><\/p>',nCb='=',TJb='=(?!=)',QJb='==',Xxb='=============\n',Uxb='===========
